import React from 'react';
import { NavbarBase, Item } from './styled';
const Component = ({ items }) => {

    const renderItems = () => {
        items.map((item, index) => <Item key={`${index}-item`} onClick={() => console.log(item.value)}>{item.name}</Item>)
    }
    return (
        <NavbarBase>
            {renderItems()}
        </NavbarBase>
    );
}

export default Component;
export { Component as NavbarBase }
